/*Table structure for table `useractivitylogfile` */

DROP TABLE IF EXISTS `useractivitylogfile`;

CREATE TABLE `useractivitylogfile` (
  `recid` bigint(20) NOT NULL AUTO_INCREMENT,
  `modcde` varchar(50) DEFAULT NULL,
  `usrcde` varchar(50) DEFAULT NULL,
  `usrname` varchar(30) DEFAULT NULL,
  `usrdte` datetime DEFAULT NULL,
  `usrtim` varchar(15) DEFAULT NULL,
  `trndte` datetime DEFAULT NULL,
  `module` varchar(100) DEFAULT NULL,
  `activity` varchar(100) DEFAULT NULL,
  `empcode` varchar(20) DEFAULT NULL,
  `fullname` varchar(100) DEFAULT NULL,
  `remarks` text DEFAULT NULL,
  `linenum` int(11) DEFAULT 0,
  `parameter` varchar(50) DEFAULT NULL,
  `webpage` varchar(50) DEFAULT NULL,
  `usrnam` varchar(20) DEFAULT NULL,
  `ipaddress` varchar(30) DEFAULT NULL,
  `pcdomainname` varchar(50) DEFAULT NULL,
  `pcusername` varchar(50) DEFAULT NULL,
  `osversion` text DEFAULT NULL,
  `pagename` varchar(255) DEFAULT NULL,
  `method` varchar(255) DEFAULT NULL,
  `status` varchar(7) DEFAULT NULL,
  `log_dbname` varchar(50) DEFAULT NULL,
  `log_tablename` varchar(50) DEFAULT NULL,
  `log_recid` varchar(20) DEFAULT NULL,
  `logdte_client` datetime DEFAULT NULL,
  `logdte_server` datetime DEFAULT NULL,
  `system_version` varchar(15) DEFAULT NULL,
  `newval` varchar(255) DEFAULT NULL,
  `oldval` varchar(255) DEFAULT NULL,
  `fields` varchar(8000) DEFAULT NULL,
  `field1` varchar(50) DEFAULT NULL,
  `field2` varchar(50) DEFAULT NULL,
  `field3` varchar(50) DEFAULT NULL,
  `logatt` text DEFAULT NULL,
  `subdrycde` varchar(20) DEFAULT NULL,
  `table1` varchar(50) DEFAULT NULL,
  `table2` varchar(50) DEFAULT NULL,
  `table3` varchar(50) DEFAULT NULL,
  `value1` varchar(50) DEFAULT NULL,
  `value2` varchar(50) DEFAULT NULL,
  `value3` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`recid`),
  KEY `useractivitylogfile_logdte_client_index` (`logdte_client`),
  KEY `useractivitylogfile_activity_usrdte_index` (`activity`,`usrdte`)
) ENGINE=InnoDB AUTO_INCREMENT=1202 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='ADDED BY LstvPoco ON 17.07.17 19:02';

